---@class LeaderBookSound_Xls : table 
LeaderBookSound_Xls =
{
    ["200100101"]={soundId=200100101,leaderId=2001001,soundName="登录问候·白天",characterVoiceId=2001101,soundText="你来了啊，导师。",soundOpen=1},
    ["200100102"]={soundId=200100102,leaderId=2001001,soundName="登录问候·白天·亲密",characterVoiceId=2001102,soundText="唔嘿，真的没办法碰到云层啊……啊！导师您什么时候来的？",soundOpen=6},
    ["200100103"]={soundId=200100103,leaderId=2001001,soundName="登录问候·夜晚",characterVoiceId=2001103,soundText="源能海的浪真漂亮啊，导师。",soundOpen=1},
    ["200100104"]={soundId=200100104,leaderId=2001001,soundName="登录问候·夜晚·亲密",characterVoiceId=2001104,soundText="尼伯龙根号上有很多很黑的地方，那些地方究竟藏着什么呢。",soundOpen=6},
    ["200100105"]={soundId=200100105,leaderId=2001001,soundName="闲置·一",characterVoiceId=2001105,soundText="在这里待久了会着凉的，导师，我们去船舱里面吧……导师？",soundOpen=1},
    ["200100106"]={soundId=200100106,leaderId=2001001,soundName="闲置·二",characterVoiceId=2001106,soundText="不知道天空的上方又会是怎样的景象呢？",soundOpen=1},
    ["200100107"]={soundId=200100107,leaderId=2001001,soundName="闲置·三",characterVoiceId=2001107,soundText="偶尔能像这样稍微放松一下，似乎也不错嘛~",soundOpen=1},
    ["200100108"]={soundId=200100108,leaderId=2001001,soundName="问候·清晨",characterVoiceId=2001108,soundText="那里的光，无论什么时候都那么耀眼……啊，导师早上好。",soundOpen=1},
    ["200100109"]={soundId=200100109,leaderId=2001001,soundName="成为助手",characterVoiceId=2001109,soundText="需要处理的事务我已经整理好了，导师，您辛苦了。",soundOpen=1},
    ["200100110"]={soundId=200100110,leaderId=2001001,soundName="交谈·一",characterVoiceId=2001110,soundText="头发又翘起来了啊……",soundOpen=1},
    ["200100111"]={soundId=200100111,leaderId=2001001,soundName="交谈·二",characterVoiceId=2001111,soundText="我有帮上导师的忙么？",soundOpen=1},
    ["200100112"]={soundId=200100112,leaderId=2001001,soundName="交谈·三",characterVoiceId=2001112,soundText="有的时候我也很疑惑为什么我拥有如此充沛的源能，或许，导师可以找到答案？",soundOpen=1},
    ["200100113"]={soundId=200100113,leaderId=2001001,soundName="交谈·四",characterVoiceId=2001113,soundText="世界树总是闪烁着耀眼的光，那种光……不，没什么。",soundOpen=4},
    ["200100114"]={soundId=200100114,leaderId=2001001,soundName="交谈·五",characterVoiceId=2001114,soundText="斯露德们都拥有无与伦比的歌喉，希望有一天她们的歌声能够自由响彻在这片天空之下，没有厌弃，不会带来灾厄，只是歌者在放声歌唱。",soundOpen=5},
    ["200100115"]={soundId=200100115,leaderId=2001001,soundName="交谈·六",characterVoiceId=2001115,soundText="导师，您知道飞鱼的习性么，这些小家伙会在野花盛开的季节聚集起来，去寻找源能密集的地方繁衍生息。也就是说，如果源能海面继续下降的话，它们就要无家可归了……所以为了飞鱼们，请尽快行动吧。",soundOpen=6},
    ["200100116"]={soundId=200100116,leaderId=2001001,soundName="交谈·七",characterVoiceId=2001116,soundText="导师导师，看我雕刻的小飞鱼！谁教我的木雕？嘿嘿，是、秘、密、哦~",soundOpen=7},
    ["200100117"]={soundId=200100117,leaderId=2001001,soundName="交谈·八",characterVoiceId=2001117,soundText="等到这个世界停止憎恨的那一天，如果，真的有那样一天的话，我有一个请求……您愿意听听我的愿望么，导师?",soundOpen=8},
    ["200100118"]={soundId=200100118,leaderId=2001001,soundName="我的生日",characterVoiceId=2001118,soundText="哼~哼~哼~哼~哼~哼~……咿呀！导师什么时候出现在背后的！我的生日？非常感谢，总感觉，有些开心。",soundOpen=1},
    ["200100119"]={soundId=200100119,leaderId=2001001,soundName="导师生日",characterVoiceId=2001119,soundText="祝您生日快乐，这真是一件值得庆祝的事情，大家都很开心啊，像纪念日一样……是不是设立成节日会更好呢？唔……",soundOpen=1},
    ["200100120"]={soundId=200100120,leaderId=2001001,soundName="长时间游玩",characterVoiceId=2001120,soundText="导师，该休息了，其他的事交给我就好。",soundOpen=1},
    ["200100121"]={soundId=200100121,leaderId=2001001,soundName="长时间未登录问候·一",characterVoiceId=2001121,soundText="是您！您终于回来了，导师，欢迎回来。",soundOpen=1},
    ["200100122"]={soundId=200100122,leaderId=2001001,soundName="长时间未登录问候·二",characterVoiceId=2001122,soundText="能再次见到您，真是太好了。",soundOpen=8},
    ["200100123"]={soundId=200100123,leaderId=2001001,soundName="摇晃手机时·一",characterVoiceId=2001123,soundText="有危险，导师快退后。",soundOpen=1},
    ["200100124"]={soundId=200100124,leaderId=2001001,soundName="摇晃手机时·二",characterVoiceId=2001124,soundText="船在摇动，是哪里出现故障了吗？",soundOpen=1},
    ["200100125"]={soundId=200100125,leaderId=2001001,soundName="快速点击·一",characterVoiceId=2001125,soundText="怎么？有什么事吗？",soundOpen=1},
    ["200100126"]={soundId=200100126,leaderId=2001001,soundName="快速点击·二",characterVoiceId=2001126,soundText="导师？",soundOpen=1},
    ["200200101"]={soundId=200200101,leaderId=2002001,soundName="登录问候·白天",characterVoiceId=2002101,soundText="哈……早啊，导师。",soundOpen=1},
    ["200200102"]={soundId=200200102,leaderId=2002001,soundName="登录问候·白天·亲密",characterVoiceId=2002102,soundText="你终于来了啊导师，让我等了很久啊。",soundOpen=6},
    ["200200103"]={soundId=200200103,leaderId=2002001,soundName="登录问候·夜晚",characterVoiceId=2002103,soundText="这里的风吹着还挺舒服的。",soundOpen=1},
    ["200200104"]={soundId=200200104,leaderId=2002001,soundName="登录问候·夜晚·亲密",characterVoiceId=2002104,soundText="天上那个大灯泡能不能关掉啊，照的我都没法睡觉了。",soundOpen=6},
    ["200200105"]={soundId=200200105,leaderId=2002001,soundName="闲置·一",characterVoiceId=2002105,soundText="就算让我留在这里偷懒，工钱我可是照收不误的。",soundOpen=1},
    ["200200106"]={soundId=200200106,leaderId=2002001,soundName="闲置·二",characterVoiceId=2002106,soundText="zzzzzZZZ……唔……啊，风太舒服一不小心就睡着了。",soundOpen=1},
    ["200200107"]={soundId=200200107,leaderId=2002001,soundName="闲置·三",characterVoiceId=2002107,soundText="喂，喂……你不会真的睡着了吧导师？",soundOpen=1},
    ["200200108"]={soundId=200200108,leaderId=2002001,soundName="问候·清晨",characterVoiceId=2002108,soundText="这会儿的阳光可真是让人犯困。是吧？",soundOpen=1},
    ["200200109"]={soundId=200200109,leaderId=2002001,soundName="成为助手",characterVoiceId=2002109,soundText="竟然会让我来帮你，你这人还真是随便啊。这部分记得算入工钱啊，我去那边待着，有事了再叫我。",soundOpen=1},
    ["200200110"]={soundId=200200110,leaderId=2002001,soundName="交谈·一",characterVoiceId=2002110,soundText="哟，你带了不少好吃的嘛，我就不客气了啊。",soundOpen=1},
    ["200200111"]={soundId=200200111,leaderId=2002001,soundName="交谈·二",characterVoiceId=2002111,soundText="那群家伙怎么每次见到我都躲得远远的，我有那么可怕吗？",soundOpen=1},
    ["200200112"]={soundId=200200112,leaderId=2002001,soundName="交谈·三",characterVoiceId=2002112,soundText="将源能像这样汇聚，然后“嘭”的一下发射出去就可以了……这样做不对么？就算你说不对也没有用，这可是很久以前有个整天笑嘻嘻的家伙教我的啦。",soundOpen=1},
    ["200200113"]={soundId=200200113,leaderId=2002001,soundName="交谈·四",characterVoiceId=2002113,soundText="我一直都在帮卡娜莉亚收集她需要的材料，作为报酬，她会给我提供我需要的道具，这可不是什么秘密交易。有了这些小道具，就算是源能不如其他人的我也还是能够收拾掉这些异生体的。",soundOpen=4},
    ["200200114"]={soundId=200200114,leaderId=2002001,soundName="交谈·五",characterVoiceId=2002114,soundText="在黑街那个地方，能够活下来已经是一种奢望，黑硬的面包，无处躲藏的街道，残破的建筑物，冻死饿死也不过是家常便饭。那里的人为什么不去其他地方？当然想啊，可被抛弃的人怎么会有家呢。",soundOpen=5},
    ["200200115"]={soundId=200200115,leaderId=2002001,soundName="交谈·六",characterVoiceId=2002115,soundText="导师，帮我递一下那边的钳子。好嘞，今天的保养工作搞定。嗯？这些可都是保命的东西，不好好保养可是会出大问题的！",soundOpen=6},
    ["200200116"]={soundId=200200116,leaderId=2002001,soundName="交谈·七",characterVoiceId=2002116,soundText="有的时候你也别那么拼命，还是稍微爱惜一下自己的身体吧，人一旦没命就什么也做不了了，这种道理用不着我来告诉你吧。",soundOpen=7},
    ["200200117"]={soundId=200200117,leaderId=2002001,soundName="交谈·八",characterVoiceId=2002117,soundText="这枚硬币？是一位对我很重要的人给我的。每个人总有一两件特别的东西吧，或许有一天我会把这枚硬币的故事讲给你听，但不是现在。",soundOpen=8},
    ["200200118"]={soundId=200200118,leaderId=2002001,soundName="我的生日",characterVoiceId=2002118,soundText="问我有什么想要的礼物？为什么突然……啊！今天是我生日啊。那，那就随便说一句生日快乐好了啊。",soundOpen=1},
    ["200200119"]={soundId=200200119,leaderId=2002001,soundName="导师生日",characterVoiceId=2002119,soundText="喂，今天是你的生日吧，生日快乐。哈？礼物？那种东西我没有准备啦。什么？维拉那家伙竟然也送了礼物？！唔……唔，那这个小玩意儿送给你好啦，这可是我的珍藏品！",soundOpen=1},
    ["200200120"]={soundId=200200120,leaderId=2002001,soundName="长时间游玩",characterVoiceId=2002120,soundText="你怎么还在研究怎么战斗啊，一炮全部轰飞不就好了。",soundOpen=1},
    ["200200121"]={soundId=200200121,leaderId=2002001,soundName="长时间未登录问候·一",characterVoiceId=2002121,soundText="唷，来啦。……先说清楚啊，你的零食被我吃光了，就算怪我也没用啊。",soundOpen=1},
    ["200200122"]={soundId=200200122,leaderId=2002001,soundName="长时间未登录问候·二",characterVoiceId=2002122,soundText="结果还是一声不吭就离开吗……算了，记得回来就好。",soundOpen=8},
    ["200200123"]={soundId=200200123,leaderId=2002001,soundName="摇晃手机时·一",characterVoiceId=2002123,soundText="在做什么啊！导师也太幼稚了吧。",soundOpen=1},
    ["200200124"]={soundId=200200124,leaderId=2002001,soundName="摇晃手机时·二",characterVoiceId=2002124,soundText="喂喂喂喂，你在干什么！",soundOpen=1},
    ["200200125"]={soundId=200200125,leaderId=2002001,soundName="快速点击·一",characterVoiceId=2002125,soundText="哈？你找打么？",soundOpen=1},
    ["200200126"]={soundId=200200126,leaderId=2002001,soundName="快速点击·二",characterVoiceId=2002126,soundText="不要戳我了啊！我醒着的！",soundOpen=1},
    ["200300101"]={soundId=200300101,leaderId=2003001,soundName="登录问候·白天",characterVoiceId=2003101,soundText="导师导师，从这里往下看好高啊！",soundOpen=1},
    ["200300102"]={soundId=200300102,leaderId=2003001,soundName="登录问候·白天·亲密",characterVoiceId=2003102,soundText="锵锵锵~锵锵~~被夏洛吓了一跳吧！哎？没有？失败了啊……"},
    ["200300103"]={soundId=200300103,leaderId=2003001,soundName="登录问候·夜晚",characterVoiceId=2003103,soundText="哇！夜晚的天空好美啊，夏洛触手可及！"},
    ["200300104"]={soundId=200300104,leaderId=2003001,soundName="登录问候·夜晚·亲密",characterVoiceId=2003104,soundText="导师你来了呀，坐在这里吹吹晚风真是难得的惬意呀~"},
    ["200300105"]={soundId=200300105,leaderId=2003001,soundName="闲置·一",characterVoiceId=2003105,soundText="这里的景色……导师是不是也看入迷了呀？"},
    ["200300106"]={soundId=200300106,leaderId=2003001,soundName="闲置·二",characterVoiceId=2003106,soundText="哼哼哼~哼哼哼哼哼~咦？好像是谁哼过这个旋律，唔，是谁呢？"},
    ["200300107"]={soundId=200300107,leaderId=2003001,soundName="闲置·三",characterVoiceId=2003107,soundText="现在小声地演奏一下乐器也没关系的吧。"},
    ["200300108"]={soundId=200300108,leaderId=2003001,soundName="问候·凌晨",characterVoiceId=2003108,soundText="这个时间了导师你竟然还没休息啊！夏洛吗？夏洛一直都超——有精神的！"},
    ["200300109"]={soundId=200300109,leaderId=2003001,soundName="成为助手",characterVoiceId=2003109,soundText="导师！夏洛来啦！有什么话想要和夏洛说么？尽管说吧！夏洛一定会做一位优秀的倾听者的！"},
    ["200300110"]={soundId=200300110,leaderId=2003001,soundName="交谈·一",characterVoiceId=2003110,soundText="唱歌么？唔……啊！不可以唱！夏洛唱歌会吸引来异生体的！"},
    ["200300111"]={soundId=200300111,leaderId=2003001,soundName="交谈·二",characterVoiceId=2003111,soundText="在天空中待久了偶尔也会怀念地上的生活呀……"},
    ["200300112"]={soundId=200300112,leaderId=2003001,soundName="交谈·三",characterVoiceId=2003112,soundText="将源能释放出一点后覆盖在自己的身上就可以提升感知力啦，虽然听起来很简单，其实操作起来还蛮困难的，需要大量的练习还有一点天赋啦~"},
    ["200300113"]={soundId=200300113,leaderId=2003001,soundName="交谈·四",characterVoiceId=2003113,soundText="你问我为什么会留在尼伯龙根号上？唔，在这里可以去各种不同的地方，还可以遇见很多有趣的人，最重要的是，这种生活可是夏洛一直很向往的！"},
    ["200300114"]={soundId=200300114,leaderId=2003001,soundName="交谈·五",characterVoiceId=2003114,soundText="以前在家里的时候，偶尔也会像这样去阳台上休憩一下，但阳台前的只是一尘不变的景色，如今能够见到这样不断变化的景象是那时的我最初的梦想，谢谢导师实现我最初的梦想！"},
    ["200300115"]={soundId=200300115,leaderId=2003001,soundName="交谈·六",characterVoiceId=2003115,soundText="导师，前不久奈纳说去旅行要准备好多好多钱的，夏洛并没有准备就跑了出来，这可怎么办呀，不知道哪里可以抵押式杖呢……哎？不可以么？唔，那就只能想想别的办法了呀……"},
    ["200300116"]={soundId=200300116,leaderId=2003001,soundName="交谈·七",characterVoiceId=2003116,soundText="时常出现在夏洛脑海之中的声音，与其说那是歌声，倒不如说是恸哭要更贴切一些，虽然夏洛很想立刻把这台出现故障的播放器关掉，但果然还是应该先搞清楚发出悲鸣的究竟是什么，探索未知才是旅行的真谛嘛！"},
    ["200300117"]={soundId=200300117,leaderId=2003001,soundName="交谈·八",characterVoiceId=2003117,soundText="无论什么样的旅途，都会有终点，一段旅程的终点或许是另一段旅程的起点。导师，等我们到达这一程的终点后，要不要和夏洛一起踏上新的旅途呢？"},
    ["200300118"]={soundId=200300118,leaderId=2003001,soundName="我的生日",characterVoiceId=2003118,soundText="导师怎么会在这里？是特地来祝我生日快乐的？夏洛竟然收到了导师的祝福！太好啦！"},
    ["200300119"]={soundId=200300119,leaderId=2003001,soundName="导师生日",characterVoiceId=2003119,soundText="今天是你的生日吧导师，生日快乐！现在夏洛都没法给导师唱生日歌，总有一天，我一定会认认真真地给导师唱生日歌的！"},
    ["200300120"]={soundId=200300120,leaderId=2003001,soundName="长时间游玩",characterVoiceId=2003120,soundText="虽然夏洛很欣赏导师沉迷工作的样子……但是持续劳动会让效率降低的哦？"},
    ["200300121"]={soundId=200300121,leaderId=2003001,soundName="长时间未登录问候·一",characterVoiceId=2003121,soundText="导师！突然听到导师熟悉的声音，夏洛还有点……不能哭啦！"},
    ["200300122"]={soundId=200300122,leaderId=2003001,soundName="长时间未登录问候·二",characterVoiceId=2003122,soundText="好久不见！夏洛不想和导师分开，只能在记忆中……没事的，你能回来我很开心~"},
    ["200300123"]={soundId=200300123,leaderId=2003001,soundName="摇晃手机时·一",characterVoiceId=2003123,soundText="头，头好晕。"},
    ["200300124"]={soundId=200300124,leaderId=2003001,soundName="摇晃手机时·二",characterVoiceId=2003124,soundText="呜哇啊啊啊！"},
    ["200300125"]={soundId=200300125,leaderId=2003001,soundName="快速点击·一",characterVoiceId=2003125,soundText="太快了！给夏洛一点时间反应啊？"},
    ["200300126"]={soundId=200300126,leaderId=2003001,soundName="快速点击·二",characterVoiceId=2003126,soundText="咿呀！导师你在做什么？！"},
